import logo from './logo.png';

export default function(){
        const [Mobile,setMobile] = useState('')
    const [password,setPassword] = useState('')

    const handlesubmit = async () => {
        const res = await axios.post('')
    }
    return (
        <div className={styles.logcont}>
            <img src={logo} width={200} height={200} alt="logo"/>
        <div className={styles.logDiv}>

           <h2> Login</h2>
           <input type='text' placeholder='Lab Name'  value={Mobile} onChange={(e)=>setMobile(e.target.value)}/><br/>
        <input type='text' placeholder='Address'  value={password} onChange={(e)=>setPassword(e.target.value)} /> <br/>
          <button onClick={handlesubmit} className={styles.logBtn}>Login</button>
          <p>Existing User? <Link to='/register'>Sign Up</Link></p>
          </div>
        </div>
    )
}
